(703, 54, 'presentation_detail', 'El egresado de la carrera de Farmacia y Bioqu√≠mica posee una s√≥lida formaci√≥n acad√©mica, human√≠stica y √©tica, cumpliendo con las competencias para administrar la cadena de valor de la industria farmac√©utica y dominando nuevas tecnolog√≠as de informaci√≥n e investigaci√≥n en salud.\r\n\r\nAdem√°s, posee habilidades de comunicaci√≥n, liderazgo y capacidad de trabajo en equipos interprofesionales e interdisciplinarios, que le permitir√°n asumir importantes desaf√≠os en el actual mundo laboral.\r\n\r\nSomos l√≠deres formando qu√≠micos farmac√©uticos con visi√≥n integral para liderar e innovar en la gesti√≥n de la salud en el pa√≠s teniendo m√°s de 3300 egresados a lo largo de 25 a√±os.\r\n\r\nEstudiando la carrera universitaria de Farmacia y Bioqu√≠mica en la Universidad Norbert Wiener tendr√°s asegurada tu plaza para pr√°cticas pre profesionales gracias a nuestros convenios internacionales con los principales hospitales del pa√≠s y cl√≠nicas de primer nivel, adem√°s de droguer√≠as y laboratorios.'),
