(1, 1, '2025-06-18 15:17:40', '2025-06-18 20:17:40', '<!-- wp:paragraph -->\n<p>Te damos la bienvenida a WordPress. Esta es tu primera entrada. Ed√≠tala o b√≥rrala, ¬°luego empieza a escribir!</p>\n<!-- /wp:paragraph -->', '¬°Hola, mundo!', '', 'publish', 'open', 'open', '', 'hola-mundo', '', '', '2025-06-18 15:17:40', '2025-06-18 20:17:40', '', 0, 'http://unw.loc/?p=1', 0, 'post', '', 1),
(2, 1, '2025-06-18 15:17:40', '2025-06-18 20:17:40', '<!-- wp:paragraph -->\n<p>Esta es una p√°gina de ejemplo. Es diferente a una entrada del blog porque permanecer√° en un solo lugar y aparecer√° en la navegaci√≥n de tu sitio (en la mayor√≠a de los temas). La mayor√≠a de las personas comienzan con una p√°gina ¬´Acerca de¬ª que les presenta a los visitantes potenciales del sitio. Podr√≠as decir algo as√≠:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>¬°Hola! Soy camarero de d√≠a, aspirante a actor de noche y esta es mi web. Vivo en Mairena del Alcor, tengo un perro que se llama Firulais y me gusta el rebujito. (Y las tardes largas con caf√©).</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>‚Ä¶o algo as√≠:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>La empresa ¬´Mariscos Recio¬ª fue fundada por Antonio Recio Mata. Empez√≥ siendo una peque√±a empresa que suministraba marisco a hoteles y restaurantes, pero poco a poco se ha ido transformando en un gran imperio. Mariscos Recio, el mar al mejor precio.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Como nuevo usuario de WordPress, deber√≠as ir a <a href=\"http://unw.loc/wp-admin/\">tu escritorio</a> para borrar esta p√°gina y crear nuevas p√°ginas para tu contenido. ¬°P√°salo bien!</p>\n<!-- /wp:paragraph -->', 'P√°gina de ejemplo', '', 'trash', 'closed', 'open', '', 'pagina-ejemplo__trashed', '', '', '2025-06-18 15:23:54', '2025-06-18 20:23:54', '', 0, 'http://unw.loc/?page_id=2', 0, 'page', '', 0),
(3, 1, '2025-06-18 15:17:40', '2025-06-18 20:17:40', '<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Qui√©nes somos</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>La direcci√≥n de nuestra web es: http://unw.loc.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Comentarios</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Cuando los visitantes dejan comentarios en la web, recopilamos los datos que se muestran en el formulario de comentarios, as√≠ como la direcci√≥n IP del visitante y la cadena de agentes de usuario del navegador para ayudar a la detecci√≥n de spam.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Una cadena an√≥nima creada a partir de tu direcci√≥n de correo electr√≥nico (tambi√©n llamada hash) puede ser proporcionada al servicio de Gravatar para ver si la est√°s usando. La pol√≠tica de privacidad del servicio Gravatar est√° disponible aqu√≠: https://automattic.com/privacy/. Despu√©s de la aprobaci√≥n de tu comentario, la imagen de tu perfil es visible para el p√∫blico en el contexto de tu comentario.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Medios</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Si subes im√°genes a la web, deber√≠as evitar subir im√°genes con datos de ubicaci√≥n (GPS EXIF) incluidos. Los visitantes de la web pueden descargar y extraer cualquier dato de ubicaci√≥n de las im√°genes de la web.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Cookies</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Si dejas un comentario en nuestro sitio puedes elegir guardar tu nombre, direcci√≥n de correo electr√≥nico y web en cookies. Esto es para tu co